  const { Buscar } = props;

  return (
    <div>
      <Menu />
      <h1 style={{ textAlign: "center" }}>
        Noticias
      </h1>

    </div>
  );
}



buscar.getInitialProps = async () => {
  const res = await fetch("https://api-test-ln.herokuapp.com/articles");
  const buscar = await res.json();

  return { buscar };
};


